import React from "react";

const SkillBar = ({ width, name }) => {
  return (
    <div className="skillContainer">
      <div className="name">{name}</div>
      <div className="skill" style={{ width: `${width}%` }}></div>
      {/* <div className="percent">{width}</div> */}
      {width}
    </div>
  );
};

export default SkillBar;
